svg.script:
var Quartaus = document.getElementById("Quartaus");
var Quarthervor = document.getElementById("Quarthervor");
var BHG = document.getElementById("BHG");
var FHG = document.getElementById("FHG")


function addEventListeners() {
    Quarthervor.addEventListener('mouseover', BRegister);
    Quarthervor.addEventListener('mouseout', FRegister);
}

addEventListeners()

function FRegister() {
Quarthervor.style.opacity = "1";
BHG.style.opacity = "0.6"
FHG.style.opacity = "1.0"
}

function BRegister() {
Quarthervor.style.opacity ="0";
BHG.style.opacity = "1.0"
FHG.style.opacity = "0.6"
}
